import React from "react";

const Veriler = (props) => {
  const { veri } = props;
  console.log(veri);
  return (
    <div className="Veri">
      <div className="Tarih">
        <p style={{ fontWeight: "bold", fontStyle: "italic" }}>
          {veri.copyright}
        </p>
        <p> Date : {veri.date}</p>
      </div>
      <img src={veri.url} style={{ width: "80%" }} />
      <p>{veri.explanation}</p>
    </div>
  );
};

export default Veriler;
